import React from "react";
import Logo from "../assets/Logo.svg"
import { Link } from "react-router-dom";
const Navbar = (props) => {
    const isLoggedIn = this.isLoggedIn;
    const setIsLoggedIn = this.setIsLoggedIn
    return (
        <div>
            <Link>
                <img src={Logo}></img>
            </Link>
            <nav>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/">About</Link>
                    </li>
                    <li>
                        <Link to="/">Contact</Link>
                    </li>
                </ul>
            </nav>
            <div>
                {
                    !isLoggedIn && <Link>
                    Log in
                    </Link>
}
{
                     !isLoggedIn && <Link>
                     Sign up
                     </Link>
}
{
                      isLoggedIn && <Link>
                      Log out
                      </Link>
}
{
                       isLoggedIn && <Link>
                       Dashboard
                       </Link>
                }
            </div>
        </div>
    );
}
export default Navbar;
